        const activeBtn = document.getElementById('btn-' + lang);
        if (activeBtn) {
            activeBtn.classList.add('active');
        }
        
        // Sauvegarder la préférence
        localStorage.setItem('ontowave-lang', lang);
        
        // Mettre à jour les textes de l'interface OntoWave
